// SPDX-License-Identifier: MIT

pragma solidity ^0.8.4;

import "./interface/IBetPair.sol";
import "./interface/IMarket.sol";
import "./interface/IBet.sol";
import "./interface/IWeb3BetsFO.sol";

contract BetPair is IBetPair {

    address private web3betsAddress;

    address public override market;

    address public override sideABet;

    address public override sideBBet;

    address public override winnerBet;

    address public override winnerAddress;

    uint public override amountA;

    uint public override amountB;

    IWeb3BetsFO private web3bets = IWeb3BetsFO(web3betsAddress);

    constructor (
        address marketAddress_,
        address sideABetAddress_,
        address sideBBetAddress_,
        uint amountA_,
        uint amountB_
    ) {
        require(msg.sender == web3bets.factory(), "only web3bets fixedodds factory contract can create this contract");
        market = marketAddress_;
        sideABet = sideABetAddress_;
        sideBBet = sideBBetAddress_;
        amountA = amountA_;
        amountB = amountB_;
    }

    function setWinnerBet( address _addr) external override returns(bool){
        winnerBet = _addr;
        IBet _bet = IBet(winnerBet);
        winnerAddress = _bet.better();
        return true;
    }

}

